import React from 'react'
import Image from "./hero.jpg"

const CTA = () => {
    return (
        <div className='text-center max-w-max text-white text-base font-bold p-3 rounded-full px-5 bg-black px-10'>Button</div>
    )
}

const Hero = () => {
    return (
        <div className='h-screen relative'>
            <img src={Image} alt='sports' className='h-full object-cover transform translate-x-10'/>
            <div className='absolute text-white inset-0 w-full h-full flex flex-col justify-evenly'>
                <div className='font-extrabold text-3xl text-center p-10'>FOR THE NEW GENERATION OF SPORTS.</div>
            </div>
        </div>
    )
}

const OLDHero = () => {
    return (
        <div>
            <div className='flex flex-col h-screen justify-evenly items-center text-center bg-gray-50'>
                <img src={Image} alt='sports' className='justify-self-start'/>
                <div className='font-extrabold text-3xl'>FOR THE NEW GENERATION OF SPORTS.</div>
                <CTA />
            </div>
        </div>
    )
}

const Tokenomics = () => { 
    return (
        <div className='flex flex-col justify-evenly bg-gray-100'>
            <div className='font-extrabold text-2xl'>SECTION 1</div>
            <div className='font-medium text-lg bg-gray-400 p-5 m-5 rounded'>
                <div className='font-bold'>Title 1</div>
                <div>Insert information here</div>
            </div>
            <CTA />
        </div>
    )
}

const Home = () => {
    return (
        <div>
            <Hero />
            <Tokenomics />
        </div>
    )
}

export default Home
